public class InnerRouteRouteSpecFactory(Action<Humidifier.AppMesh.RouteTypes.RouteSpec> factoryAction = null) : SubResourceFactory<Humidifier.AppMesh.RouteTypes.RouteSpec>
{

    internal InnerRouteHttpRouteFactory HttpRouteFactory { get; set; }

    internal InnerRouteHttpRouteFactory Http2RouteFactory { get; set; }

    internal InnerRouteGrpcRouteFactory GrpcRouteFactory { get; set; }

    internal InnerRouteTcpRouteFactory TcpRouteFactory { get; set; }

    protected override Humidifier.AppMesh.RouteTypes.RouteSpec Create()
    {
        var routeSpecResult = CreateRouteSpec();
        factoryAction?.Invoke(routeSpecResult);

        return routeSpecResult;
    }

    private Humidifier.AppMesh.RouteTypes.RouteSpec CreateRouteSpec()
    {
        var routeSpecResult = new Humidifier.AppMesh.RouteTypes.RouteSpec();

        return routeSpecResult;
    }
    public override void CreateChildren(Humidifier.AppMesh.RouteTypes.RouteSpec result)
    {
        base.CreateChildren(result);

        result.HttpRoute ??= HttpRouteFactory?.Build();
        result.Http2Route ??= Http2RouteFactory?.Build();
        result.GrpcRoute ??= GrpcRouteFactory?.Build();
        result.TcpRoute ??= TcpRouteFactory?.Build();
    }

} // End Of Class

